(2013, 10876, 'o', 'opschluessel_1|opschluessel_2|opschluessel_3|opschluessel_4|opschluessel_5|opschluessel_6', 'BET IN (1,3) AND (LOCATE(\'5-872\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-874\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-876\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0)', '"brusterhaltende Therapie (BET) " ist ja und ein Listenfeld "Operation" ist in OPS-Liste \'Prozeduren Mastektomie\'', 'h'),
(2013, 10877, 'o', 'sentinellkeingriff', 'SENTINELLKEINGRIFF IN (\'1\',\'\') AND SLKBIOPSIE = 0', '"Sentinel-Lymphknoten-Biopsie bei diesem Eingriff durchgeführt" ist  "ja" [1] oder"leer" und "Sentinel-Lymphknoten-Biopsie bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist  "nein" [0]', 'h'),
(2013, 10881, 'o', 'opschluessel_1|opschluessel_2|opschluessel_3|opschluessel_4|opschluessel_5|opschluessel_6', '(LOCATE(\'5-401.10\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-406.10\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-406.11\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-406.12\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-406.13\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-406.1x\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-407.00\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-407.01\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-407.02\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-407.03\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-407.0x\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0) AND AXILLADISSEKTION = 0', 'Hinweis: Ein Listenfeld "Operation" ist in OPS-Liste \'Axilladissektion\' und "axilläre Lymphknotenentfernung ohne Markierung bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist  "nein" [0]', 'w'),
(2013, 10925, 'b', 'aufndatum', 'abs(YEAR(AUFNDATUM)  - YEAR(GEBDATUM) - TIMESTAMPDIFF(YEAR, GEBDATUM, AUFNDATUM)) > 1', 'Die Differenz zwischen den Jahreswerten am Aufnahmetag und Geburtsdatum und berechnetem Alter am Aufnahmetag ist größer  als 1 oder kleiner als -1', 'h'),
(2013, 10962, 'b', 'aufndatum', 'YEAR(AUFNDATUM)  - YEAR(GEBDATUM) - TIMESTAMPDIFF(YEAR, GEBDATUM, AUFNDATUM)=-1', 'Die Differenz zwischen den Jahreswerten am Aufnahmetag und Geburtsdatum und berechnetem Alter am Aufnahmetag ist -1', 'h'),
(2013, 11321, 'brust', 'optherapieende|tnmptmamma', 'OPTHERAPIEENDE != \'1\' AND TNMPTMAMMA != \'\'', '"primär-operative Therapie abgeschlossen" ist nicht  "ja" [1], obwohl "pT" ausgefüllt ist', 'h'),
(2013, 12116, 'brust', 'posticdo3|graddcis', 'POSTICDO3 NOT IN (\'8500/2\',\'8503/2\',\'8504/2\',\'8507/2\',\'8540/3\',\'8543/3\') AND GRADDCIS != \'\'', '"(Histologie und Staging) maligne Neoplasie" ist nicht "Duktales in-situ-Karzinom", obwohl "Grading" ausgefüllt ist', 'h'),
(2013, 12117, 'brust', 'optherapieende|graddcis', 'OPTHERAPIEENDE != \'1\' AND GRADDCIS != \'\'', '"primär-operative Therapie abgeschlossen" ist nicht  "ja" [1], obwohl "Grading" ausgefüllt ist', 'h'),
(2013, 12122, 'brust', 'praeoptumorth|tnmptmamma', 'PRAEOPTUMORTH = 0 AND TNMPTMAMMA IN (\'ypTis\', \'ypTX\', \'ypT0\', \'ypT1mic\', \'ypT1a\', \'ypT1b\', \'ypT1c\', \'ypT2\', \'ypT3\', \'ypT4a\', \'ypT4b\', \'ypT4c\', \'ypT4d\')', '"präoperative tumorspezifische Therapie" ist  "nein" [0] und "pT" ist yPT', 'h'),
(2013, 12123, 'brust', 'praeoptumorth|tnmptmamma', 'PRAEOPTUMORTH = \'1\' AND (TNMPTMAMMA = \'\' OR LEFT(TNMPTMAMMA,1) != \'y\')', '"präoperative tumorspezifische Therapie" ist  "ja" [1] und "pT" ist nicht ypT oder nicht ausgefüllt', 'h'),
(2013, 12141, 'brust', 'posticdo3|optherapieende|graddcis', 'POSTICDO3 IN (\'8500/2\',\'8503/2\',\'8504/2\',\'8507/2\',\'8540/3\',\'8543/3\') AND OPTHERAPIEENDE = \'1\' AND GRADDCIS = \'\'', '"(Histologie und Staging) maligne Neoplasie" ist "Duktales in-situ-Karzinom" und "primär-operative Therapie abgeschlossen" ist  "ja" [1], obwohl "Grading" nicht ausgefüllt ist', 'h'),
(2013, 12142, 'brust', 'rezeptorstatus|optherapieende', 'OPTHERAPIEENDE != \'1\' AND REZEPTORSTATUS != \'\'', '"primär-operative Therapie abgeschlossen" ist nicht  "ja" [1], obwohl "immunhistochemischer Hormonrezeptorstatus" ausgefüllt ist', 'h'),
(2013, 12184, 'brust', 'tnmpnmamma|arterkrank', 'ARTERKRANK != \'1\' AND TNMPNMAMMA != \'\'', '"Erkrankung an dieser Brust" ist nicht  "Primärerkrankung" [1], obwohl "pN" ausgefüllt ist', 'h'),
(2013, 12193, 'brust', 'arterkrank|tnmptmamma', 'ARTERKRANK != \'1\' AND TNMPTMAMMA != \'\'', '"Erkrankung an dieser Brust" ist nicht  "Primärerkrankung" [1], obwohl "pT" ausgefüllt ist', 'h'),
(2013, 12198, 'brust', 'slkbiopsie|radionuklidmarkierung', '( SLKBIOPSIE = \'\' OR SLKBIOPSIE != \'1\' ) AND RADIONUKLIDMARKIERUNG != \'\'', '"Sentinel-Lymphknoten-Biopsie bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist nicht  "ja" [1], obwohl "Radionuklidmarkierung" ausgefüllt ist', 'h'),
(2013, 12199, 'brust', 'slkbiopsie|farbmarkierung', '( SLKBIOPSIE = \'\' OR SLKBIOPSIE != \'1\' ) AND FARBMARKIERUNG != \'\'', '"Sentinel-Lymphknoten-Biopsie bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist nicht  "ja" [1], obwohl "Farbmarkierung" ausgefüllt ist', 'h'),
(2013, 12200, 'brust', 'slkbiopsie|radionuklidmarkierung|farbmarkierung', 'SLKBIOPSIE = \'1\' AND RADIONUKLIDMARKIERUNG = \'\' AND FARBMARKIERUNG = \'\'', '"Sentinel-Lymphknoten-Biopsie bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist  "ja" [1], obwohl  keines  der Felder (Art der Markierung) "Radionuklidmarkierung" und "Farbmarkierung" ausgefüllt ist', 'h'),
(2013, 12238, 'brust', 'ausganghistbefund', 'TIMESTAMPDIFF(DAY, AUSGANGHISTBEFUND, AUFNDATUM) >= 365', 'Hinweis: Datum des prätherapeutischen histologischen Befundes liegt weiter zurück als 365 Tage vor stationärer Aufnahme: bitte überprüfen Sie die Richtigkeit der Angaben.', 'w'),
(2013, 12239, 'brust', 'tnmpnmamma|anzahllypmphknoten', 'TNMPNMAMMA NOT IN (\'pN0(sn)\',\'pN1(sn)\',\'pN1mi(sn)\',\'pNX(sn)\',\'ypN0(sn)\',\'ypN1(sn)\',\'ypN1mi(sn)\',\'ypNX(sn)\') AND ANZAHLLYPMPHKNOTEN IN (1,2,3)', 'Hinweis: "pN" ist nicht "pN-Staging mit Angabe (sn)" und "Anzahl histologisch untersuchter regionärer Lymphknoten" ist (1;2;3)', 'w'),
(2013, 12266, 'b', NULL, 'TIMESTAMPDIFF(YEAR, GEBDATUM, NOW()) > 130', 'Patient/-in ist am aktuellen Datum älter als 130 Jahre', 'h'),
(2013, 12393, 'brust', 'angabensicherabstand|tnmptmamma', 'ANGABENSICHERABSTAND = 2 AND TNMPTMAMMA NOT IN (\'ypT0\',\'\')', 'Hinweis: "Angaben des Pathologen zum metrischen Sicherheitsabstand" ist  "Vollremission nach neoadjuvanter Therapie" [2] und "pT" ist nicht  "ypT0" [ypT0] oder"leer"', 'w'),
(2013, 12791, 'brust', 'axilladissektion|slkbiopsie|tnmpnmamma', 'AXILLADISSEKTION = 0 AND SLKBIOPSIE = \'1\' AND TNMPNMAMMA NOT IN (\'pN0(sn)\',\'pN1(sn)\',\'pN1mi(sn)\',\'pNX(sn)\',\'ypN0(sn)\',\'ypN1(sn)\',\'ypN1mi(sn)\',\'ypNX(sn)\')', 'Sie haben eine SLNB dokumentiert, jedoch keine axilläre Lymphknotenentfernung ohne Markierung. Der Zusatz (sn) bei der Angabe von pN ist deshalb erforderlich.', 'h'),
(2013, 12792, 'brust', 'axilladissektion|slkbiopsie|tnmpnmamma', 'AXILLADISSEKTION = \'1\' AND SLKBIOPSIE = 0 AND TNMPNMAMMA IN (\'pN0(sn)\',\'pN1(sn)\',\'pN1mi(sn)\',\'pNX(sn)\',\'ypN0(sn)\',\'ypN1(sn)\',\'ypN1mi(sn)\',\'ypNX(sn)\')', 'Sie haben eine axilläre Lymphknotenentfernung ohne Markierung dokumentiert, jedoch keine SLNB. Der Zusatz (sn) bei der Angabe von pN ist deshalb nicht zulässig.', 'h'),
(2013, 13121, 'brust', 'tnmpnmamma|anzahllypmphknoten', 'TNMPNMAMMA = \'\' AND ANZAHLLYPMPHKNOTEN != \'\'', '"pN" ist "leer", obwohl "Anzahl histologisch untersuchter regionärer Lymphknoten" ausgefüllt ist', 'h'),
(2013, 13122, 'brust', 'tnmpnmamma|anzahllypmphknotenunb', 'TNMPNMAMMA = \'\' AND ANZAHLLYPMPHKNOTENUNB != \'\'', '"pN" ist "leer", obwohl "Anzahl histologisch untersuchter regionärer Lymphknoten unbekannt" ausgefüllt ist', 'h'),
(2013, 13123, 'brust', 'tnmpnmamma|anzahllypmphknoten|anzahllypmphknotenunb', 'TNMPNMAMMA != \'\' AND ANZAHLLYPMPHKNOTEN = \'\' AND ANZAHLLYPMPHKNOTENUNB = \'\'', '"pN" ist nicht "leer", obwohl  keines  der Felder (Histologisch untersuchte regionäre Lymphknoten) "Anzahl histologisch untersuchter regionärer Lymphknoten" und "Anzahl histologisch untersuchter regionärer Lymphknoten unbekannt" ausgefüllt ist', 'h'),
(2013, 13124, 'brust', 'tnmpnmamma|anzahllypmphknoten|anzahllypmphknotenunb', 'TNMPNMAMMA != \'\' AND ANZAHLLYPMPHKNOTEN != \'\' AND ANZAHLLYPMPHKNOTENUNB != \'\'', '"pN" ist nicht "leer" und "Anzahl histologisch untersuchter regionärer Lymphknoten" ist ausgefüllt, obwohl "Anzahl histologisch untersuchter regionärer Lymphknoten unbekannt" ausgefüllt ist', 'h'),
(2013, 13613, 'b', NULL, 'YEAR(GEBDATUM) > YEAR(NOW())', 'Das Geburtsjahr des Patienten liegt nach dem aktuellen Datum', 'h'),
(2013, 13690, 'o', 'opschluessel_1|opschluessel_2|opschluessel_3|opschluessel_4|opschluessel_5|opschluessel_6', 'SLKBIOPSIE = 0 AND (LOCATE(\'5-401.11\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0 OR LOCATE(\'5-401.12\', CONCAT_WS(\'|\', OPSCHLUESSEL_1, OPSCHLUESSEL_2, OPSCHLUESSEL_3, OPSCHLUESSEL_4, OPSCHLUESSEL_5, OPSCHLUESSEL_6)) != 0)', 'Hinweis: "Sentinel-Lymphknoten-Biopsie bei diesem oder vorausgegangenem Aufenthalt durchgeführt" ist  "nein" [0] und ein Listenfeld "Operation" ist 5-401.11,5-401.12', 'w'),
(2013, 13706, 'b', 'aufndatum|entldatum', '((TIMESTAMPDIFF(DAY, AUFNDATUM, ENTLDATUM)) > 300) AND ((TIMESTAMPDIFF(DAY, AUFNDATUM, ENTLDATUM)) <= 396)', 'Abstand zwischen Aufnahme- und Entlassdatum beträgt mehr als 300 Tage!', 'w'),
(2013, 13727, 'o', 'opdatum', '((ENTLDATUM - OPDATUM) > 200) AND ((ENTLDATUM - OPDATUM) <= 396)', 'Abstand zwischen OP- und Entlassdatum beträgt mehr als 200 Tage!', 'w');
